text:
 @RunvoltsATPR09  Principais Títulos do Botafogo de Futebol e Regatas:
1. 2 Campeonatos Brasileiros: 1968 e 1995;
2. 1 Copa CONMEBOL: 1993
3. 21 títulos estaduais - Sendo o único tetra-campeão de forma consecutiva nos anos de 1932, 33, 34 e 35;
4. 4 Torneios Rio-São Paulo: 1962, 64, 66 e 98.
5. Total de títulos oficiais: 32 Nacionais: 2, Continental: 1, 6 interestaduais e 21 regionais. Isso fora o fato de ter sido o clube com mais jogadores cedidos à seleção brasileira e o clube que mais contribuiu efetivamente para as conquistas da seleção.

 @adelioaraujo5217  que a chance aumentou depois que o Lage saiu eu concordo. Mas o desenho tático mudou. 
Se vc rever o jogo vai reparar que todo tiro de meta era pro tiquinho na PONTA. E qnd o Tiquinho saiu, Diego Costa foi pra ponta, deixando claro que era uma decisão tática. Botafogo não saiu jogando uma única vez no jogo todo, coisa que o time fez o campeonato inteiro.
Qual o sentido de botar centro avante na ponta?
